var tipuesearch = {"pages": [{'title': '關於我們', 'text': '國立找到田科技大學機械設計工程系 \n National Found-Tien University of Technology \n 歡迎來到NFT科技大學 \n 我們跟早稻田沒有任何關係 \n 純粹是學校旁邊都是田 \n 這是我們小夥伴耍腦的地方，希望這裡能讓你獲得到你想要的東西。 \n \n', 'tags': '', 'url': '關於我們.html'}, {'title': '痛苦的學科', 'text': '這裡專門放讓我感到痛苦的東西 \n', 'tags': '', 'url': '痛苦的學科.html'}, {'title': 'The Server Is Down', 'text': '這裡專門放一些解決奇怪問題的小方法 \n \n', 'tags': '', 'url': 'The Server Is Down.html'}, {'title': 'WCM2025', 'text': '', 'tags': '', 'url': 'WCM2025.html'}, {'title': '東西向拔蘿蔔', 'text': '', 'tags': '', 'url': '東西向拔蘿蔔.html'}, {'title': '老師版', 'text': 'def turn(n):\n    for i in range(n):\n        turn_left()\n        \ndef turn_right():\n    for i in range(3):\n        turn_left()\n        \ndef new_move(n):\n    for i in range(n):\n        move()\n        \ndef harvest_one_row():\n    global object_taken\n    while object_here() and object_taken < 36:\n        take()\n        object_taken += 1\n    # 只要沒達到 36 就繼續 move\n    if object_taken < 36:\n        move()\n        \ndef is_facing_east():\n    # 記錄原本面向的方向\n    count = 0\n    while not is_facing_north():\n        turn_left()\n        count += 1\n        if count == 4:\n            break\n    # 轉到北方後，左轉三次就會面向東\n    turn(3)\n    return True\n\nobject_taken = 0\n# move to the field\nnew_move(2)\nturn_left()\nnew_move(2)\n\ndone = False\nwhile is_facing_east() and not done:\n    for i in range(2):\n        # 面向東直走收成\n        for j in range(6):\n            harvest_one_row()\n            if object_taken >= 36:\n                done = True\n                break\n        if done:\n            break\n        for k in range(2):\n            turn_left()\n            move()\n        # 面向西直走收成\n        for j in range(6):\n            harvest_one_row()\n            if object_taken >= 36:\n                done = True\n                break\n        if done:\n            break\n        for k in range(2):\n            turn_right()\n            move()\n    if object_taken >= 36:\n        print("task completed!")\n        break \n', 'tags': '', 'url': '老師版.html'}, {'title': '我的版本', 'text': 'def is_facing_west():\n    turn(3)\n    result = is_facing_north()\n    turn_left()\n    return result\n\ndef turn(times):  # 改参数名避免覆盖内置类型\n    for i in range(times):\n        turn_left()\n        \ndef new_move(steps):  # 改参数名避免覆盖内置类型\n    for i in range(steps):\n        move()\n        \ndef harvest_one_row():\n    while object_here():\n        take()\n    else:\n        move()\n\n# move to the field\nturn_left()\nnew_move(2)\nturn(3)\nnew_move(2)\n\n# 原有的3行收割逻辑\nfor i in range(3):\n    while is_facing_west():\n        for _ in range(6):\n            harvest_one_row()\n        for _ in range(2):\n            turn(3)\n            move() \n    else:\n        for _ in range(6):\n            harvest_one_row()\n        for _ in range(2):\n            turn(1)\n            move()\n\n# 新增：收割剩余5个胡萝卜的程序\ndef harvest_remaining_carrots():\n \n    \n    # 收割剩余的5个胡萝卜（具体路径需要根据实际布局调整）\n    for _ in range(6):\n        while object_here():\n            take()\n        move()  # 移动到下一个位置\n\n# 执行剩余胡萝卜的收割\nharvest_remaining_carrots()\nnew_move(1) \n', 'tags': '', 'url': '我的版本.html'}, {'title': 'wiat參考', 'text': '# pip install waitress\nfrom waitress import serve\nfrom cmsimde.flaskapp import app\n\nif __name__ == "__main__":\n    serve(app, host="::1", port=8080, threads=8)', 'tags': '', 'url': 'wiat參考.html'}, {'title': 'nginx 參考', 'text': "\n worker_processes  auto;\n\nevents {\n    worker_connections  1024;\n}\n\nhttp {\n    include       mime.types;\n    default_type  application/octet-stream;\n    sendfile        on;\n    keepalive_timeout  65;\n\n    # HTTP 服务器（仅 IPv6）\n    server {\n        listen [::]:80;  # 仅监听 IPv6\n        server_name w51.mde.nfu.edu.tw;\n\n        root html;\n        index index.html index.htm;\n\n        # 静态资源路径\n        location /reeborg {\n            alias html/reeborg;\n            try_files $uri $uri/ =404;\n        }\n\n        # 强制跳转到 HTTPS（IPv6 地址）\n        location / {\n            return 301 https://$host$request_uri;\n        }\n    }\n\n    # HTTPS 服务器（仅 IPv6）\n    server {\n        listen [::]:443 ssl;  # 仅监听 IPv6\n        server_name w51.mde.nfu.edu.tw;\n\n        # SSL 证书配置\n        ssl_certificate      conf/fullchain.pem;\n        ssl_certificate_key  conf/privkey.pem;\n\n        # 安全协议和加密套件\n        ssl_protocols TLSv1.2 TLSv1.3;\n        ssl_ciphers 'ECDHE-ECDSA-AES128-GCM-SHA256:ECDHE-RSA-AES128-GCM-SHA256:ECDHE-ECDSA-AES256-GCM-SHA384:ECDHE-RSA-AES256-GCM-SHA384';\n        ssl_prefer_server_ciphers on;\n        ssl_session_cache shared:SSL:10m;\n        ssl_session_timeout 1d;\n\n        # 代理到后端的 IPv6 地址（确保后端服务监听 [::1] 或全局 IPv6）\n        location / {\n            proxy_pass http://[::1]:8080;  # 必须使用 IPv6 地址\n            proxy_set_header Host $host;\n            proxy_set_header X-Real-IP $remote_addr;\n            proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;\n            proxy_set_header X-Forwarded-Proto $scheme;\n        }\n\n        # 静态资源路径（直接由 Nginx 处理）\n        location /reeborg {\n            alias html/reeborg;\n            try_files $uri $uri/ =404;\n        }\n    }\n} \n", 'tags': '', 'url': 'nginx 參考.html'}, {'title': '出公差囉！', 'text': '這裡專門放一些出公差的小記錄 \n \n \n', 'tags': '', 'url': '出公差囉！.html'}]};